def isHypotenuse(num):
    a, b = 1, 1
    a2, b2 = a**2, b**2
    while a2 + b2 <= num:
        while a2 + b2 <= num:
            if a2 + b2 == num:
                return True
            b += 1
            b2 = b**2
        a += 1
        a2 = a**2
        b = 1
        b2 = b**2
    return False
for x in range(20000):
    if isHypotenuse(x * int(str(x)[::-1])):
        print(x)

